import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import HomeScreen from "../HomeScreen";
const AppRoutes = () => {
  return (
    <Router>
      <Route path="/about">
        <About />
      </Route>
      <Route path="/">
        <HomeScreen />
      </Route>
    </Router>
  );
};

export default AppRoutes;

function About() {
  return <h2>About</h2>;
}
